    def add(a, b):
        return (a % mod + b % mod) % mod

    def mul(a, b):
        return a % mod * (b % mod) % mod

    def sub(a, b):
        return (a - b + mod) % mod
    x = 0
    for i in range(60):
        if N >> i & 1:
            x = i
    dp = [0 for _ in range(M + 1)]
    for i in range(1, M + 1):
        dp[i] = 1
    for i in range(x - 1, -1, -1):
        prefix = [0 for _ in range(M + 1)]
        for j in range(1, M + 1):
            prefix[j] = add(prefix[j - 1], dp[j])
        for j in range(1, M + 1):
            if i & 1 == 0:
                this = sub(prefix[M], prefix[j])
                dp[j] = mul(this, this)
            else:
                this = prefix[j - 1]
                dp[j] = mul(this, this)
    ans = 0
    for j in range(1, M + 1):
        ans = add(ans, dp[j])
    return ans

